function run(StatusAvatar, StatusRepository) {
	let apiError = 0

	if(StatusAvatar != 200 || StatusRepository != 200) {
		let apiError = 1
	}

	return apiError
}

function run(corpo) {
    let repositories = JSON.parse(corpo);  
    let namesObject = repositories.reduce((acc, repo, index) => {
        acc[`nome${index + 1}`] = repo.name;  
        return acc;
    }, {});  
    return namesObject; 
}

function run(corpo) {
    let repositories = JSON.parse(corpo);  
    let descriptionObjects = repositories.reduce((acc, repo, index) => {
        acc[`nome${index + 1}`] = repo.description;  
        return acc;
    }, {});  
    return descriptionObjects; 
}
